I want to thank all the clients/friends that have supported my career and that have put money and time and effort into how I support myself and my daughter. Without you guys I would literally be a starving artist and I know and recognize that. I want to say thank you by doing another large give away after the new year drops, I just wanna put the bug in y’all’s ear to stay frosty on my posts. 🙏🏼🙏🏼🙏🏼

@built4speedtattoo 
@adenna_tattoo 
